import React from "react";

function DriveVideoEmbed({videoUrl, height, width}) {

    return (
        <div style={{ width: "100%" }}> {/* 9:16 = 9/16 = 0.5625 */}
            <iframe
                src={videoUrl}
                style={{
                    top: 0,
                    left: 0,
                    width: width,
                    height: height,
                    border: "none",
                }}
                allow="autoplay"
                title="Google Drive Video"
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
